import React from 'react';
import ReactChessboard from 'react-chessboard';


/*
  Chessboard Component
  - position: a FEN string representing the current board state
  - onDrop: function that is called when a piece is dropped (moved)
*/
const Chessboard = ({ position, onDrop }) => {
  return (
    <div>
      <ReactChessboard position={position} onPieceDrop={onDrop} />
    </div>
  );
};

export default Chessboard;
